import Image1 from "./images/barbeque-chicken.jpg";
import Image2 from "./images/creamy-mashed-potatoes.jpg";
import Image3 from "./images/smoothy.jpg";
import Image4 from "./images/deruny.jpg";
import Image5 from "./images/meatballs.jpg";
import Image6 from "./images/chocolate-chip-cookies.jpg";
import Image7 from "./images/pesto-lasagna-rolls.jpg";
import Image8 from "./images/funeral-potatoes.jpg";
import Image9 from "./images/roasted-brussel-sprouts.jpg";

const Images = [
  null,
  Image1,
  Image2,
  Image3,
  Image4,
  Image5,
  Image6,
  Image7,
  Image8,
  Image9,
];

export default Images;
